  return (
    <div className="form">
      <form>
        {typeOfForm === "login" ? (
          <div>
            <div>Login</div>
            <div>
              New to Cryptoid?{" "}
              <span
                onClick={() => {
                  setTypeOfForm("signup");
                }}
              >
                Create an account
              </span>
            </div>
          </div>
        ) : (
          <div>Sign Up</div>
        )}
        <div>Log In</div>
        <div></div>
        <div></div>
      </form>
    </div>
  );
}
